import * as React from "react";
import { Text, View, Image } from "react-native";

export const Home = () => {
  return (
    <View
      style={{
        alignItems: "flex-start",
      }}
    >
      <View
        style={{
          flexDirection: "row",
          alignItems: "flex-start",
          marginStart: 3,
        }}
      >
        <View
          style={{
            alignItems: "flex-start",
            width: 428,
            height: 61.68,
            borderWidth: 1,
            borderColor: "rgba(112, 112, 112, 255)",
            backgroundColor: "rgba(250, 250, 250, 255)",
          }}
        >
          <View
            style={{
              flexDirection: "row",
              alignItems: "flex-start",
              paddingStart: 178.75,
              paddingTop: 17.92,
              width: 428,
              height: 61.68,
              borderWidth: 1,
              borderColor: "rgba(112, 112, 112, 255)",
              backgroundColor: "rgba(250, 250, 250, 255)",
            }}
          >
            <Text
              style={{
                fontSize: 20,
                color: "rgba(112, 112, 112, 255)",
                marginTop: 0.08,
              }}
            >
              {" "}
              PetZone{" "}
            </Text>
            <View
              style={{
                alignItems: "flex-start",
                marginStart: 146.32,
              }}
            >
              <View
                style={{
                  alignItems: "flex-start",
                  paddingTop: 0,
                }}
              >
                <View
                  style={{
                    width: 22.91,
                    height: 24.31,
                    backgroundColor: "#000000",
                  }}
                />
              </View>
            </View>
          </View>
        </View>
        <Image
          style={{
            marginStart: -427,
            marginTop: 1,
            width: 59.56,
            height: 61.68,
            borderWidth: 1,
            borderColor: "rgba(0, 0, 0, 0)",
          }}
        />
      </View>
      <Image
        style={{
          marginStart: 1.5,
          marginTop: 77.85,
          width: 428,
          height: 285.33,
        }}
      />
      <View
        style={{
          alignItems: "flex-start",
          marginStart: 3,
          marginTop: -342.19,
        }}
      >
        <View
          style={{
            flexDirection: "row",
            alignItems: "flex-start",
          }}
        >
          <Image
            style={{
              width: 52,
              height: 52,
              borderRadius: 26,
              transform: [
                {
                  scaleX: 1.06,
                },
              ],
            }}
            source={{}}
          />
          <View
            style={{
              flexDirection: "row",
              alignItems: "flex-start",
              marginStart: 328.5,
              marginTop: 12.7,
            }}
          >
            <View
              style={{
                alignItems: "flex-start",
                width: 5.64,
                height: 5.64,
                borderRadius: 2.8185653686523438,
                transform: [
                  {
                    scaleX: 1.06,
                  },
                ],
                backgroundColor: "rgba(38, 38, 39, 255)",
              }}
            />
            <View
              style={{
                alignItems: "flex-start",
                marginStart: 2.13,
                width: 5.64,
                height: 5.64,
                borderRadius: 2.8185653686523438,
                transform: [
                  {
                    scaleX: 1.06,
                  },
                ],
                backgroundColor: "rgba(38, 38, 39, 255)",
              }}
            />
            <View
              style={{
                alignItems: "flex-start",
                marginStart: 2.21,
                width: 5.64,
                height: 5.64,
                borderRadius: 2.8185653686523438,
                transform: [
                  {
                    scaleX: 1.06,
                  },
                ],
                backgroundColor: "rgba(38, 38, 39, 255)",
              }}
            />
          </View>
          <Text
            style={{
              fontSize: 16,
              color: "rgba(38, 38, 39, 255)",
              marginStart: -341.05,
              marginTop: 26,
            }}
          >
            Cairo, Egypt
          </Text>
          <Text
            style={{
              fontWeight: "bold",
              fontSize: 21,
              color: "rgba(38, 38, 39, 255)",
              marginStart: -88,
              marginTop: 3,
            }}
          >

            pet_owner
          </Text>
        </View>
        <View
          style={{
            alignItems: "flex-start",
            marginTop: 3.85,
            width: 428,
            height: 1,
            backgroundColor: "rgba(219, 219, 219, 255)",
          }}
        />
      </View>
      <View
        style={{
          alignItems: "flex-start",
          marginStart: 3,
          marginTop: 288.85,
        }}
      >
        <View
          style={{
            flexDirection: "row",
            alignItems: "flex-start",
          }}
        >
          {
            <View
              style={{
                width: 28.35,
                height: 23.68,
                backgroundColor: "#000000",
              }}
            />
          }
          {
            <View
              style={{
                width: 26,
                height: 23.68,
                backgroundColor: "#000000",
              }}
            />
          }
        </View>
        <Text
          style={{
            fontWeight: "bold",
            fontSize: 17,
            color: "rgba(38, 38, 39, 255)",
            marginTop: 11.3,
          }}
        >
          130 Likes
        </Text>
        <View
          style={{
            flexDirection: "row",
            alignItems: "flex-start",
          }}
        >
          <Text
            style={{
              fontWeight: "bold",
              fontSize: 17,
              color: "rgba(38, 38, 39, 255)",
              marginTop: 7,
            }}
          >
            drawzen_design
          </Text>
          <Text
            style={{
              fontSize: 18,
              color: "rgba(38, 38, 39, 255)",
              marginStart: 21,
              marginTop: 7,
            }}
          >

            my dog!!
          </Text>
        </View>
        <Text
          style={{
            fontSize: 11,
            color: "rgba(171, 171, 172, 255)",
            marginTop: 6,
          }}
        >
          10 MINUTES AGO
        </Text>
      </View>
      <View
        style={{
          flexDirection: "row",
          alignItems: "flex-start",
          marginTop: 320.63,
        }}
      >
        <View
          style={{
            flexDirection: "row",
            alignItems: "flex-start",
            paddingStart: 42.5,
            paddingTop: 12,
            marginTop: 1,
            width: 426,
            height: 76,
            backgroundColor: "rgba(250, 250, 250, 255)",
          }}
        >
          <View
            style={{
              width: 38.7,
              height: 37.63,
              backgroundColor: "#000000",
            }}
          />

          <View
            style={{
              width: 42.6,
              height: 42.4,
              backgroundColor: "#000000",
            }}
          />

          <View
            style={{
              width: 48,
              height: 48,
              backgroundColor: "#000000",
            }}
          />
          <Image
            style={{
              marginStart: 39,
              width: 52,
              height: 52,
            }}
            source={
              {
                /* add your source here */
              }
            }
          />
          <Image
            style={{
              marginStart: 39,
              marginTop: 5.37,
              width: 46.92,
              height: 46.92,
            }}
            source={
              {
                /* add your source here */
              }
            }
          />
        </View>
        <View
          style={{
            alignItems: "flex-start",
            marginStart: -425,
            width: 433,
            height: 1,
            backgroundColor: "rgba(178, 178, 178, 255)",
          }}
        />
      </View>
    </View>
  );
};
